import logo from './logo.svg';
import './App.css';
import './MemberOverview'
import { MemberOverview } from './MemberOverview';
import { ChakraProvider } from '@chakra-ui/react'

function App() {
  return (
    <ChakraProvider><div className="App">
      <header className="App-header">
        <MemberOverview />
      </header>
    </div> </ChakraProvider>

  );
}

export default App;
